import React, {Component} from 'react';

class Header extends Component{
    render() {
        return (
            <nav id="navigation" className="navigation_nav-container">
                <a className="navigation-logo" href="/Home">Nav Bar</a>
                <div className="navigation-auth"> 
                    <button ng-click="login()" class="navigation-auth_login-button" translate="navigation.connect.login">Log In</button> 
                    <button ng-click="signup()" class="navigation-auth_signup-button" translate="navigation.connect.signup">Sign Up</button> 
                </div>
            </nav>
        )

    }

}

export default Header
